export default function  Copyright() {
  return (
      <div style={{ color: 'gray', position: 'absolute', bottom: '0', left: '0', right: '0' }}>
        <h6 style={{ lineHeight: '0' }}>충남 천안시</h6>
        <h6 style={{ lineHeight: '0' }}>Copyright ⓒ 2023 Dike Engineering & Construction Corporation, All rights Reserved</h6>
        <h6 style={{ lineHeight: '0' }}>Dike 정책 | 개인정보처리 방침 | 고객센터</h6>
      </div>
  );
}
